def distribute_medals(participants, total_participants):
    d = {}
    temp = total_participants / 2
    for no in participants:
        if temp - 1 >= 0:
            temp -= 1
            if no in d:
                d[no] += 1
            else:
                d[no] = 1
        else:
            if no in d:
                del d[no]
            break
    if len(d) < 3:
        return (0, 0, 0)
    gold = d[participants[0]]
    del d[participants[0]]
    if gold >= total_participants // 2 + 1:
        return (0, 0, 0)
    silver = 0
    to_delete = []
    for (key, val) in d.items():
        silver += val
        to_delete.append(key)
        if silver > gold:
            break
    for key in to_delete:
        del d[key]
    if silver <= gold:
        return (0, 0, 0)
    bronze = 0
    for (key, val) in d.items():
        bronze += val
    if bronze <= gold:
        return (0, 0, 0)
    return (gold, silver, bronze)

